import React, { useState } from 'react';
import { Card, CardContent, Avatar, Typography, IconButton } from '@mui/material';
import FavoriteIcon from '@mui/icons-material/Favorite';
import ChatBubbleOutlineIcon from '@mui/icons-material/ChatBubbleOutline';
import SendIcon from '@mui/icons-material/Send';
import SaveIcon from '@mui/icons-material/Save';
import MoreHorizIcon from '@mui/icons-material/MoreHoriz';
import './style_home.css'; 
import { createTheme, ThemeProvider } from '@mui/material/styles'; 
import StoryBar from '../component/Storybar';
import Rightbar from '../component/Rightbar';
import "../component/components.css"
import boy from '../component/assets/Ezz.png';


const posts = [
  {
    username: 'user1',
    caption: 'Caption 1',
    imageUrl: 'https://car-images.bauersecure.com/wp-images/13349/1056x594/80-mercedes-amg-gt63-e-performance-hero.jpg',
  },
  {
    username: 'user2',
    caption: 'Caption 2',
    imageUrl: 'https://via.placeholder.com/500x500',
  },
];

const theme = createTheme({
  palette: {
    primary: {
      main: '#FFFFFF',
    },
    secondary: {
      main: '#FFFFFF',
    },
  },
});

const Home = () => {
  const [likes, setLikes] = useState(Array(posts.length).fill(false));

  const toggleLike = (index) => {
    const updatedLikes = [...likes];
    updatedLikes[index] = !updatedLikes[index];
    setLikes(updatedLikes);
  };

  const handleDoubleClick = (index) => {
    const updatedLikes = [...likes];
    updatedLikes[index] = true; 
    setLikes(updatedLikes);
  };

  const Post = ({ username, caption, imageUrl, index }) => {
    const liked = likes[index]; 

    return (
      <Card className="post" sx={{  backgroundColor: 'black' }}>
        {/* Three Dots icon */}


        {/* User info and Post image */}
        <div className="post__content">
          <div className="post__user-info">
            <Avatar
              className="post__avatar"
              alt={username}
              src="/static/images/avatar/1.jpg" 
            />
            <div className="post__username">
              <Typography  color="white">{username}</Typography>

            </div>
            <div className="post__header">
          <IconButton className="post__dots" color="primary">
            <MoreHorizIcon />
          </IconButton>
        </div>
          </div>
          <img
            className="post__image"
            src={imageUrl}
            alt={caption}
            onDoubleClick={() => handleDoubleClick(index)} // Double-click event handler
          />
        </div>

        {/* Like, Comment, Send, and Save buttons */}
        <CardContent>
          <div className="post__buttons">
            <IconButton color={liked ? 'error' : 'primary'} onClick={() => toggleLike(index)}>
              <FavoriteIcon color="white" />
            </IconButton>
            <IconButton color='primary'>
              <ChatBubbleOutlineIcon color="white" />
            </IconButton>
            <IconButton color="primary">
              <SendIcon color="white" />
            </IconButton>
            <IconButton color="primary" className="post__save-icon">
              <SaveIcon color="white" />
            </IconButton>
          </div>

          {liked ? (
            <Typography variant="body2" color="error">
              1 like
            </Typography>
          ) : null}

          <Typography variant="body2">
            <strong>{username}</strong> {caption}
          </Typography>
        </CardContent>
      </Card>
    );
  };

  return (
    <div className='dd'>
      <StoryBar />
      <Rightbar />
      {posts.map((post, index) => (
        <Post
          key={index}
          username={post.username}
          caption={post.caption}
          imageUrl={post.bo}
          index={index}
        />
      ))}
    </div>
  );
};

export default Home;
